import React from "react";
import styled from 'styled-components';

const Card = styled.div`
  border: 1px solid black;
`;

const CharaCard = (props) => {
  return (
      <Card>
        <p>{props.name}</p>
        <p>{props.birth_year}</p>
      </Card>
  );
};

export default CharaCard;
